const WorkExperience = () => (
    <div className="container-work">
            <h1>Experiencia laboral</h1>
        <div className="work-information">
                <h2>TItulo de trabajo</h2>
                <span>Durancion</span>
                <span>Lugar</span>
                <p>Descripcion</p>
        </div>

        <div className="work-information">
                <h2>TItulo de trabajo</h2>
                <span>Durancion</span>
                <span>Lugar</span>
                <p>Descripcion</p>
        </div>

            <style jsx> {`
            .container-work{
                border: 1px solid red;
                margin-right: 70px;
                margin-top:20px;
            }
            .work-information{
                display:grid;
                grid-template-columns: repeat(340px, 1fr);
                grid-gap: 10px;
                padding-left: 30px;
                font-size: 20px;
            }
            `}
            </style>
    </div>
);

export default WorkExperience;
